(2218,'terms_of_use_page','','<h1>TERMS OF USE - WORLDMATES.CLUB SOCIAL NETWORK</h1>\n<p><strong>Last Updated:</strong> August 12, 2025<br><strong>Effective Date:</strong> August 12, 2025</p>\n<hr>\n<h2>INTRODUCTION</h2>\n<p>Welcome to Worldmates.club (the \"Site\" or \"Platform\"), a social network designed to connect people from around the world, exchange ideas, experiences, and content. These Terms of Use (\"Terms\") constitute a legally binding agreement between you (the \"User,\" \"you\") and the Site Operator &ndash; an individual entrepreneur registered in accordance with the laws of Ukraine, with registration location in Dnipro, Ukraine (\"Operator,\" \"we,\" \"us\").</p>\n<p>These Terms govern your use of the Site, including creating an account, publishing content, interacting with other users, and accessing features and services. By using the Site, you confirm that you have read, understood, and agree to these Terms, as well as the Privacy Policy and other applicable rules published on the Site.</p>\n<p>If you do not agree to these Terms, please do not register or use the Site. The Operator reserves the right to modify these Terms at any time. Changes take effect upon publication on the Site. Continued use of the Site after changes constitutes your acceptance of them. We recommend regularly checking the Terms for updates.</p>\n<p>The Site operates in accordance with Ukrainian legislation, including the Law of Ukraine \"On Media\" No. 2849-IX of December 13, 2022, the Law of Ukraine \"On Personal Data Protection\" No. 2297-VI of June 1, 2010, the Law of Ukraine \"On Advertising\" No. 270/96-VR (as amended), as well as other regulatory acts, taking into account the specifics of martial law in Ukraine (extended until November 2025) and draft laws such as No. 11115 on online platform regulation and No. 8153 on personal data protection.</p>\n<hr>\n<h2>1. GENERAL PROVISIONS AND DEFINITIONS</h2>\n<h3>1.1 Basic Provisions</h3>\n<p>These Terms of Use (hereinafter referred to as the \"Terms\") govern the relationship between WorldMates.club (hereinafter referred to as the \"Platform,\" \"Site,\" \"We\") and users (hereinafter referred to as the \"User,\" \"You\") when using the WorldMates.club social network, available at worldmates.club and its associated mobile applications and services.</p>\n<h3>1.2 Definitions</h3>\n<ul>\n<li><strong>Account</strong> &mdash; a unique user account on the Platform</li>\n<li><strong>Content</strong> &mdash; any information posted by Users: texts, images, videos, audio, comments</li>\n<li><strong>Personal Data</strong> &mdash; any information that allows identification of a natural person</li>\n<li><strong>Service</strong> &mdash; the functionality of the WorldMates.club social network</li>\n<li><strong>Administration</strong> &mdash; the management and technical support team of WorldMates.club</li>\n</ul>\n<h3>1.3 Legal Framework</h3>\n<p>These Terms have been developed in accordance with:</p>\n<ul>\n<li>Law of Ukraine \"On Media\" (No. 2849-IX of December 13, 2022)</li>\n<li>Law of Ukraine \"On Personal Data Protection\" (No. 2297-VI)</li>\n<li>EU General Data Protection Regulation (GDPR)</li>\n<li>California Consumer Privacy Act (CCPA)</li>\n<li>Civil Code of Ukraine</li>\n<li>Law of Ukraine \"On Information\"</li>\n</ul>\n<hr>\n<h2>2. ACCEPTANCE OF TERMS AND REGISTRATION</h2>\n<h3>2.1 Agreement to Terms</h3>\n<p>By using WorldMates.club, you confirm that you:</p>\n<ul>\n<li>Have read, understood, and agree to these Terms</li>\n<li>Are at least 16 years old (parental consent required for users under 16)</li>\n<li>Have the legal capacity to enter into this agreement</li>\n<li>Provide accurate information during registration</li>\n</ul>\n<h3>2.2 Registration Process</h3>\n<p>For full use of the Service, you must:</p>\n<ol>\n<li>Provide a valid email address</li>\n<li>Create a secure password (minimum 8 characters, including numbers and letters)</li>\n<li>Confirm your email address</li>\n<li>Provide your real first and last name</li>\n<li>Accept these Terms and Privacy Policy</li>\n</ol>\n<h3>2.3 Account Responsibility</h3>\n<p>The User bears full responsibility for:</p>\n<ul>\n<li>Maintaining confidentiality of login credentials</li>\n<li>All actions performed under their account</li>\n<li>Immediate notification of suspected account compromise</li>\n</ul>\n<hr>\n<h2>3. PLATFORM USAGE RULES</h2>\n<h3>3.1 Permitted Use</h3>\n<p>WorldMates.club is intended for:</p>\n<ul>\n<li>Social communication and networking</li>\n<li>Information and content sharing</li>\n<li>Creating interest-based communities</li>\n<li>Educational and entertainment activities</li>\n<li>Professional communication</li>\n</ul>\n<h3>3.2 Prohibited Actions</h3>\n<p><strong>STRICTLY PROHIBITED:</strong></p>\n<h4>3.2.1 Illegal Content</h4>\n<ul>\n<li>Posting materials that violate copyright</li>\n<li>Publishing defamatory or libelous information</li>\n<li>Distributing extremist materials</li>\n<li>Content promoting violence or discrimination</li>\n<li>Pornographic materials, especially involving minors</li>\n</ul>\n<h4>3.2.2 Violations under Ukrainian Media Law</h4>\n<ul>\n<li>Distributing information that denies the existence of the Ukrainian people or Ukrainian statehood</li>\n<li>Publishing materials that demean the Ukrainian state language</li>\n<li>Justifying the criminal nature of communist or Nazi regimes</li>\n<li>Positive coverage of activities directed against Ukrainian independence</li>\n</ul>\n<h4>3.2.3 Technical Violations</h4>\n<ul>\n<li>Attempting hacking, DDoS attacks, or disrupting Platform operations</li>\n<li>Using automated programs (bots) without permission</li>\n<li>Circumventing technical restrictions</li>\n<li>Creating viruses or malicious software</li>\n</ul>\n<h4>3.2.4 Platform Abuse</h4>\n<ul>\n<li>Spam, intrusive advertising</li>\n<li>Phishing or fraud</li>\n<li>Selling prohibited goods or services</li>\n<li>Violating other users\' privacy</li>\n</ul>\n<h3>3.3 Language Requirements</h3>\n<p>In accordance with Ukrainian media legislation:</p>\n<ul>\n<li>The primary interface language is Ukrainian</li>\n<li>Content may be published in Ukrainian, English, and other languages</li>\n<li>Discriminatory content against the Ukrainian language will result in sanctions</li>\n</ul>\n<hr>\n<h2>4. CONTENT AND INTELLECTUAL PROPERTY</h2>\n<h3>4.1 User Content</h3>\n<h4>4.1.1 Content Rights</h4>\n<ul>\n<li>You retain rights to content you create</li>\n<li>By posting content, you grant us a non-exclusive license to use it within Platform operations</li>\n<li>The license includes rights to store, display, reproduce, and distribute content</li>\n</ul>\n<h4>4.1.2 Content Responsibility</h4>\n<ul>\n<li>You bear full responsibility for posted content</li>\n<li>You guarantee that you have all necessary rights</li>\n<li>You undertake not to violate third-party rights</li>\n</ul>\n<h3>4.2 Content Moderation</h3>\n<h4>4.2.1 Automated Moderation</h4>\n<ul>\n<li>Algorithms are used to identify potentially violating content</li>\n<li>Automatic scanning for spam and malicious links</li>\n<li>Image verification for community guidelines compliance</li>\n</ul>\n<h4>4.2.2 Manual Moderation</h4>\n<ul>\n<li>Moderation team reviews user complaints</li>\n<li>Review of disputed cases within 24-72 hours</li>\n<li>Ability to appeal moderation decisions</li>\n</ul>\n<h3>4.3 Copyright</h3>\n<h4>4.3.1 DMCA Compliance</h4>\n<ul>\n<li>Procedure for filing copyright infringement complaints</li>\n<li>Content removal upon valid complaints</li>\n<li>Warning system for violators</li>\n</ul>\n<h4>4.3.2 Original Content Protection</h4>\n<ul>\n<li>Duplicate content detection technologies</li>\n<li>Priority to original source in disputes</li>\n<li>Ability to mark original content</li>\n</ul>\n<hr>\n<h2>5. PERSONAL DATA PROTECTION</h2>\n<h3>5.1 Data Processing Principles</h3>\n<p>In accordance with GDPR and Ukrainian legislation, we ensure:</p>\n<ul>\n<li><strong>Lawfulness</strong> &mdash; processing only based on consent or legal grounds</li>\n<li><strong>Data Minimization</strong> &mdash; collecting only necessary data</li>\n<li><strong>Accuracy</strong> &mdash; maintaining data currency</li>\n<li><strong>Storage Limitation</strong> &mdash; deleting data when no longer needed</li>\n<li><strong>Security</strong> &mdash; reliable protection against breaches and unauthorized access</li>\n</ul>\n<h3>5.2 Types of Data Collected</h3>\n<h4>5.2.1 Required Registration Data</h4>\n<ul>\n<li>First and last name</li>\n<li>Email address</li>\n<li>Date of birth (for age verification)</li>\n<li>Country of residence</li>\n</ul>\n<h4>5.2.2 Additional Profile Data</h4>\n<ul>\n<li>Profile photo</li>\n<li>Work and education information</li>\n<li>Interests and hobbies</li>\n<li>Contact information (optional)</li>\n</ul>\n<h4>5.2.3 Technical Data</h4>\n<ul>\n<li>IP address and location</li>\n<li>Device and browser information</li>\n<li>Activity and interaction logs</li>\n<li>Cookies and similar technologies</li>\n</ul>\n<h3>5.3 User Rights Regarding Personal Data</h3>\n<h4>5.3.1 GDPR Rights</h4>\n<ul>\n<li><strong>Right of Access</strong> &mdash; obtaining a copy of your data</li>\n<li><strong>Right to Rectification</strong> &mdash; correcting inaccurate information</li>\n<li><strong>Right to Erasure</strong> &mdash; \"right to be forgotten\"</li>\n<li><strong>Right to Restrict Processing</strong> &mdash; pausing data use</li>\n<li><strong>Right to Data Portability</strong> &mdash; receiving data in machine-readable format</li>\n<li><strong>Right to Object</strong> &mdash; refusing certain types of processing</li>\n</ul>\n<h4>5.3.2 CCPA Rights (for California residents)</h4>\n<ul>\n<li>Right to know what personal data is collected</li>\n<li>Right to delete personal data</li>\n<li>Right to opt-out of personal data sales</li>\n<li>Right to non-discriminatory service</li>\n</ul>\n<h3>5.4 International Data Transfers</h3>\n<ul>\n<li>Data may be processed in the EU, USA, and other jurisdictions</li>\n<li>Appropriate safeguards are used (Standard Contractual Clauses)</li>\n<li>Ensuring adequate protection level for international transfers</li>\n</ul>\n<h3>5.5 Data Security</h3>\n<h4>5.5.1 Technical Measures</h4>\n<ul>\n<li>Data encryption in transit (TLS 1.3)</li>\n<li>Data encryption at rest (AES-256)</li>\n<li>Regular security audits</li>\n<li>Multi-factor authentication for critical operations</li>\n</ul>\n<h4>5.5.2 Organizational Measures</h4>\n<ul>\n<li>Limited access to personal data</li>\n<li>Staff training on privacy matters</li>\n<li>Security breach notification procedures</li>\n<li>Regular security system testing</li>\n</ul>\n<hr>\n<h2>6. MINORS\' PROTECTION</h2>\n<h3>6.1 Age Restrictions</h3>\n<ul>\n<li><strong>Minimum age:</strong> 16 years (according to GDPR)</li>\n<li><strong>For users 13-15 years:</strong> parental/guardian consent required</li>\n<li><strong>For users under 13:</strong> use is prohibited</li>\n</ul>\n<h3>6.2 Additional Protection for Minors</h3>\n<h4>6.2.1 Technical Measures</h4>\n<ul>\n<li>Automatic detection of potentially dangerous content</li>\n<li>Limited visibility of minors\' profiles</li>\n<li>Additional privacy settings by default</li>\n<li>Blocking direct messages from unknown adults</li>\n</ul>\n<h4>6.2.2 Parental Controls</h4>\n<ul>\n<li>Ability to create family accounts</li>\n<li>Parental notifications of suspicious activity</li>\n<li>Tools for monitoring children\'s activity</li>\n<li>Ability to limit usage time</li>\n</ul>\n<h3>6.3 Educational Initiatives</h3>\n<ul>\n<li>Digital literacy programs</li>\n<li>Safe internet behavior training</li>\n<li>Partnerships with educational organizations</li>\n<li>Regular webinars for parents and teachers</li>\n</ul>\n<hr>\n<h2>7. COMMERCIAL USE AND ADVERTISING</h2>\n<h3>7.1 Platform Advertising</h3>\n<h4>7.1.1 Types of Advertising</h4>\n<ul>\n<li>Targeted advertising based on interests</li>\n<li>Native advertising in feeds</li>\n<li>Sponsored