ese Terms</li>\n<li>Posting illegal content</li>\n<li>Violating third-party rights</li>\n<li>Any unlawful user actions</li>\n</ul>\n<hr>\n<h2>9. MODERATION AND SANCTIONS</h2>\n<h3>9.1 Warning System</h3>\n<h4>9.1.1 Violation Gradation</h4>\n<ul>\n<li><strong>Minor:</strong> spam, inappropriate behavior (warning)</li>\n<li><strong>Medium:</strong> community guidelines violation (temporary restriction)</li>\n<li><strong>Serious:</strong> illegal content, threats (account suspension)</li>\n<li><strong>Critical:</strong> extremism, child pornography (immediate blocking and law enforcement contact)</li>\n</ul>\n<h4>9.1.2 Review Procedure</h4>\n<ol>\n<li>Automatic or manual violation detection</li>\n<li>User notification of violation</li>\n<li>Opportunity for explanation (for disputed cases)</li>\n<li>Moderation decision</li>\n<li>Sanctions notification</li>\n<li>Appeal opportunity</li>\n</ol>\n<h3>9.2 Types of Sanctions</h3>\n<h4>9.2.1 Temporary Restrictions</h4>\n<ul>\n<li>Content posting restriction (1-30 days)</li>\n<li>Messaging ban (1-7 days)</li>\n<li>Search hiding (1-14 days)</li>\n<li>Community creation restriction (7-30 days)</li>\n</ul>\n<h4>9.2.2 Permanent Sanctions</h4>\n<ul>\n<li>Complete account blocking</li>\n<li>IP address blocking</li>\n<li>Ban on creating new accounts</li>\n</ul>\n<h3>9.3 Appeal Process</h3>\n<p>Users have the right to:</p>\n<ul>\n<li>File an appeal within 30 days</li>\n<li>Provide additional explanations</li>\n<li>Receive case reconsideration</li>\n<li>Appeal to an independent arbitrator (for serious cases)</li>\n</ul>\n<hr>\n<h2>10. TECHNICAL SUPPORT AND FEEDBACK</h2>\n<h3>10.1 Support Channels</h3>\n<ul>\n<li><strong>Help Center:</strong> help.worldmates.club</li>\n<li><strong>Email:</strong> support@worldmates.club</li>\n<li><strong>Support Chat:</strong> available 24/7</li>\n</ul>\n<h3>10.2 Response Time</h3>\n<ul>\n<li><strong>Critical issues:</strong> within 2 hours</li>\n<li><strong>Regular requests:</strong> within 24 hours</li>\n<li><strong>Complex technical issues:</strong> within 72 hours</li>\n</ul>\n<h3>10.3 Support Languages</h3>\n<p>Support is available in the following languages:</p>\n<ul>\n<li>Ukrainian (primary)</li>\n<li>English</li>\n<li>Russian (for existing users)</li>\n</ul>\n<hr>\n<h2>11. CHANGES TO TERMS</h2>\n<h3>11.1 Change Notifications</h3>\n<ul>\n<li>Substantial changes: 30-day notice</li>\n<li>Technical changes: 7-day notice</li>\n<li>Legal requirement changes: immediate notification</li>\n</ul>\n<h3>11.2 Notification Methods</h3>\n<ul>\n<li>Email to all registered users</li>\n<li>Notification upon account login</li>\n<li>Publication on official website</li>\n<li>Mobile app notifications</li>\n</ul>\n<h3>11.3 Acceptance of Changes</h3>\n<p>Continued platform use after changes take effect constitutes acceptance of new terms.</p>\n<hr>\n<h2>12. TERMINATION OF USE</h2>\n<h3>12.1 User-Initiated Termination</h3>\n<p>Users may:</p>\n<ul>\n<li>Delete account at any time</li>\n<li>Request complete data deletion</li>\n<li>Export their data before deletion</li>\n</ul>\n<h3>12.2 Platform-Initiated Termination</h3>\n<p>WorldMates.club may terminate services:</p>\n<ul>\n<li>Upon substantial Terms violation</li>\n<li>By law enforcement request</li>\n<li>Due to technical impossibility of service provision</li>\n</ul>\n<h3>12.3 Termination Consequences</h3>\n<p>After termination:</p>\n<ul>\n<li>Account becomes inaccessible</li>\n<li>Personal data deleted according to Privacy Policy</li>\n<li>Public content may be preserved for discussion integrity</li>\n<li>Backup copies deleted within 90 days</li>\n</ul>\n<hr>\n<h2>13. APPLICABLE LAW AND DISPUTE RESOLUTION</h2>\n<h3>13.1 Applicable Law</h3>\n<p>These Terms are governed by Ukrainian law. Disputes are subject to consideration in Ukrainian courts, Dnipro city.</p>\n<h3>13.2 Pre-litigation Settlement</h3>\n<p>Before court proceedings, parties undertake to:</p>\n<ol>\n<li>Send written complaint</li>\n<li>Consider mediation possibility<