(2219,'privacy_policy_page','','<h1>WORLDMATES.CLUB PRIVACY POLICY</h1>\n<p><strong>Last Updated:</strong> August 12, 2025<br><strong>Effective Date:</strong> August 12, 2025</p>\n<hr>\n<h2>INTRODUCTION</h2>\n<p>Welcome to the Privacy Policy of WorldMates.club social network. This Privacy Policy (the \"Policy\") describes how WorldMates.club, operated by an individual entrepreneur registered in accordance with Ukrainian law with registration location in Dnipro, Ukraine (hereinafter \"We,\" \"Our Company,\" \"Operator\"), collects, uses, stores, and protects your personal data when using the WorldMates.club social network (hereinafter \"Service,\" \"Platform\").</p>\n<p>We take the protection of your personal data seriously and commit to ensuring their security in accordance with applicable legislation, including the Law of Ukraine \"On Personal Data Protection\" No. 2297-VI, the EU General Data Protection Regulation (GDPR), the California Consumer Privacy Act (CCPA), as well as considering the specifics of martial law in Ukraine.</p>\n<p><strong>Operator Contact Information:</strong></p>\n<ul>\n<li>Name: [Entrepreneur\'s Full Name]</li>\n<li>Registration Number: [Individual Entrepreneur Registration Number]</li>\n<li>Address: Dnipro, Ukraine, [Full Address]</li>\n<li>Email: privacy@worldmates.club</li>\n<li>Phone: [Phone Number]</li>\n</ul>\n<hr>\n<h2>1. DEFINITIONS AND KEY CONCEPTS</h2>\n<h3>1.1 Basic Terms</h3>\n<ul>\n<li><strong>Personal Data</strong> &mdash; any information that directly or indirectly allows identification of a natural person</li>\n<li><strong>Data Subject</strong> &mdash; a natural person whose data is being processed</li>\n<li><strong>Data Processing</strong> &mdash; any action with personal data: collection, recording, systematization, accumulation, storage, updating, use, transfer, deletion</li>\n<li><strong>Data Controller</strong> &mdash; WorldMates.club as the entity determining purposes and means of personal data processing</li>\n<li><strong>Consent</strong> &mdash; voluntary, specific, informed, and unambiguous consent of the data subject to processing of their personal data</li>\n</ul>\n<h3>1.2 Special Categories of Data</h3>\n<p>According to GDPR, special categories include data about:</p>\n<ul>\n<li>Racial or ethnic origin</li>\n<li>Political opinions</li>\n<li>Religious or philosophical beliefs</li>\n<li>Trade union membership</li>\n<li>Genetic and biometric data</li>\n<li>Health data</li>\n<li>Sexual orientation</li>\n</ul>\n<hr>\n<h2>2. LEGAL BASIS FOR DATA PROCESSING</h2>\n<h3>2.1 Basis under Ukrainian Legislation</h3>\n<p>Personal data processing is carried out on the following legal grounds according to the Law of Ukraine \"On Personal Data Protection\":</p>\n<ul>\n<li><strong>Data Subject Consent</strong> &mdash; voluntary consent to process specific data for defined purposes</li>\n<li><strong>Contract Performance</strong> &mdash; processing necessary for contract fulfillment with the user</li>\n<li><strong>Legal Obligations</strong> &mdash; compliance with Ukrainian legislation requirements</li>\n<li><strong>Vital Interests</strong> &mdash; protection of life and health of the data subject</li>\n<li><strong>Public Interests</strong> &mdash; performance of tasks in public interest</li>\n<li><strong>Legitimate Interests</strong> &mdash; legitimate interests of the controller while respecting data subject rights</li>\n</ul>\n<h3>2.2 Basis under GDPR (Article 6)</h3>\n<p>For EU users, processing is carried out based on:</p>\n<ol>\n<li><strong>Consent</strong> &mdash; data subject has given consent for processing</li>\n<li><strong>Contract</strong> &mdash; processing is necessary for contract performance</li>\n<li><strong>Legal Obligation</strong> &mdash; compliance with controller\'s legal obligations</li>\n<li><strong>Vital Interests</strong> &mdash; protection of vital interests</li>\n<li><strong>Public Task</strong> &mdash; performance of task in public interest</li>\n<li><strong>Legitimate Interests</strong> &mdash; legitimate interests of controller or third party</li>\n</ol>\n<h3>2.3 Processing Special Categories of Data</h3>\n<p>Special categories of data are processed only with:</p>\n<ul>\n<li>Explicit consent of the data subject</li>\n<li>Necessity for protecting vital interests</li>\n<li>Processing of data manifestly made public by the subject</li>\n<li>Prevention or detection of crimes</li>\n<li>Protection of health or social security</li>\n</ul>\n<hr>\n<h2>3. WHAT DATA WE COLLECT</h2>\n<h3>3.1 Data Provided During Registration</h3>\n<p><strong>Required Data:</strong></p>\n<ul>\n<li>First and last name (real)</li>\n<li>Email address</li>\n<li>Date of birth (for age verification)</li>\n<li>Password (stored encrypted)</li>\n<li>Country of residence</li>\n</ul>\n<p><strong>Additional Profile Data:</strong></p>\n<ul>\n<li>Profile photo</li>\n<li>Work and education information</li>\n<li>City of residence</li>\n<li>Interests and hobbies</li>\n<li>Relationship status</li>\n<li>Contact information (phone number, messengers)</li>\n<li>Biography/profile description</li>\n</ul>\n<h3>3.2 Automatically Collected Technical Data</h3>\n<p><strong>Device and Browser Data:</strong></p>\n<ul>\n<li>IP address and approximate location</li>\n<li>Device type, operating system</li>\n<li>Browser and its version</li>\n<li>Screen resolution and language settings</li>\n<li>Unique device identifiers</li>\n</ul>\n<p><strong>Website Behavior Data:</strong></p>\n<ul>\n<li>Pages you visit</li>\n<li>Time spent on site</li>\n<li>Links you click</li>\n<li>Search queries on the platform</li>\n<li>Content interactions (likes, comments, reposts)</li>\n</ul>\n<h3>3.3 Data from Third Parties</h3>\n<p><strong>Social Networks:</strong></p>\n<ul>\n<li>Data from social media profiles when logging in through them</li>\n<li>Public information from linked accounts</li>\n<li>Contacts from imported address books (with consent)</li>\n</ul>\n<p><strong>Analytics Services:</strong></p>\n<ul>\n<li>Google Analytics (visit data)</li>\n<li>Yandex.Metrica (behavioral data)</li>\n<li>Facebook Pixel (conversion data)</li>\n</ul>\n<h3>3.4 User Content</h3>\n<p><strong>Created Content:</strong></p>\n<ul>\n<li>Text posts and comments</li>\n<li>Uploaded photos and videos</li>\n<li>Audio recordings and files</li>\n<li>File metadata (creation time, geolocation)</li>\n</ul>\n<p><strong>Communications:</strong></p>\n<ul>\n<li>Private messages between users</li>\n<li>Messages in groups and communities</li>\n<li>Complaints and support requests</li>\n</ul>\n<hr>\n<h2>4. PURPOSES OF PERSONAL DATA PROCESSING</h2>\n<h3>4.1 Main Usage Purposes</h3>\n<p><strong>Service Provision:</strong></p>\n<ul>\n<li>Creating and managing user accounts</li>\n<li>Displaying personalized content</li>\n<li>Providing social interaction features</li>\n<li>Technical user support</li>\n</ul>\n<p><strong>Security and Protection:</strong></p>\n<ul>\n<li>Preventing fraud and abuse</li>\n<li>Ensuring platform security</li>\n<li>Detecting and blocking spam</li>\n<li>Enforcing community guidelines</li>\n</ul>\n<p><strong>Service Improvement:</strong></p>\n<ul>\n<li>Analyzing platform usage</li>\n<li>Developing new features</li>\n<li>Fixing bugs and improving performance</li>\n<li>Conducting user experience research</li>\n</ul>\n<h3>4.2 Marketing and Advertising</h3>\n<p><strong>Personalized Advertising:</strong></p>\n<ul>\n<li>Showing relevant advertisements</li>\n<li>Creating advertising profiles (with consent)</li>\n<li>Measuring advertising effectiveness</li>\n<li>Preventing inappropriate ad display</li>\n</ul>\n<p><strong>Marketing Communications:</strong></p>\n<ul>\n<li>Sending newsletters (with consent)</li>\n<li>Notifications about new features</li>\n<li>Personal recommendations</li>\n<li>Surveys and research (voluntary)</li>\n</ul>\n<h3>4.3 Legal Compliance</h3>\n<p><strong>Legal Obligations:</strong></p>\n<ul>\n<li>Fulfilling Ukrainian legislation requirements</li>\n<li>Complying with Ukraine\'s Media Law</li>\n<li>Providing data to law enforcement (upon request)</li>\n<li>Maintaining data processing logs</li>\n</ul>\n<p><strong>Protection of Rights and Interests:</strong></p>\n<ul>\n<li>Dispute resolution</li>\n<li>Intellectual property protection</li>\n<li>Ensuring Terms of Use compliance</li>\n<li>Crime prevention</li>\n</ul>\n<hr>\n<h2>5. CONSENT TO DATA PROCESSING</h2>\n<h3>5.1 Obtaining Consent</h3>\n<p><strong>Consent Principles:</strong></p>\n<ul>\n<li><strong>Voluntary</strong> &mdash; consent given without coercion</li>\n<li><strong>Informed</strong> &mdash; subject understands processing purposes</li>\n<li><strong>Specific</strong> &mdash; consent relates to defined purposes</li>\n<li><strong>Unambiguous</strong> &mdash; consent expressed clearly and understandably</li>\n</ul>\n<p><strong>Methods of Obtaining Consent:</strong></p>\n<ul>\n<li>Checkbox during registration</li>\n<li>Explicit consent in profile settings</li>\n<li>Consent when downloading app</li>\n<li>Continued use after change notifications</li>\n</ul>\n<h3>5.2 Withdrawal of Consent</h3>\n<p>According to GDPR and Ukrainian legislation, you have the right to withdraw consent at any time:</p>\n<p><strong>Withdrawal Methods:</strong></p>\n<ul>\n<li>Through profile settings</li>\n<li>By email to privacy@worldmates.club</li>\n<li>Through feedback form</li>\n<li>When deleting account</li>\n</ul>\n<p><strong>Consequences of Withdrawal:</strong></p>\n<ul>\n<li>Cessation of processing for voluntary purposes</li>\n<li>Possible functionality limitations</li>\n<li>Data retention for legal obligations</li>\n<li>Notification about withdrawal consequences</li>\n</ul>\n<h3>5.3 Minor Consent</h3>\n<p><strong>Special Requirements:</strong></p>\n<ul>\n<li>Age of consent: 16 years (according to GDPR)</li>\n<li>For users 13-15 years: parental/guardian consent</li>\n<li>For users under 13: use prohibited</li>\n<li>Additional protection for minor data</li>\n</ul>\n<p><strong>Verification Procedures:</strong></p>\n<ul>\n<li>Age verification during registration</li>\n<li>Document requests when false data suspected</li>\n<li>Additional protection measures for minors</li>\n<li>Parental notifications about suspicious activity</li>\n</ul>\n<hr>\n<h2>6. DATA SHARING AND THIRD-PARTY TRANSFERS</h2>\n<h3>6.1 Categories of Data Recipients</h3>\n<p><strong>Service Providers (Processors):</strong></p>\n<ul>\n<li>Hosting providers (data storage)</li>\n<li>Cloud services (backup)</li>\n<li>Analytics platforms (Google, Yandex)</li>\n<li>Payment systems (payment processing)</li>\n<li>Email delivery services (notification sending)</li>\n</ul>\n<p><strong>Integration Partners:</strong></p>\n<ul>\n<li>Social networks (Facebook, Google, VK)</li>\n<li>Advertising networks (targeted advertising display)</li>\n<li>Content providers (media files)</li>\n<li>Moderation services (content verification)</li>\n</ul>\n<h3>6.2 Legal Basis for Transfer</h3>\n<p><strong>User Consent:</strong></p>\n<ul>\n<li>Explicit consent for transfer to specific third parties</li>\n<li>Integration with external services by user choice</li>\n<li>Publishing content in public access</li>\n</ul>\n<p><strong>Legal Obligations:</strong></p>\n<ul>\n<li>Law enforcement requests (according to Ukrainian legislation)</li>\n<li>Court orders</li>\n<li>Tax legislation compliance</li>\n<li>National security protection</li>\n</ul>\n<p><strong>Legitimate Interests:</strong></p>\n<ul>\n<li>Fraud prevention</li>\n<li>Platform security assurance</li>\n<li>Protection of other users\' rights and freedoms</li>\n<li>System technical maintenance</li>\n</ul>\n<h3>6.3 International Data Transfers</h3>\n<p><strong>Transfer Countries:</strong></p>\n<ul>\n<li>EU countries (adequate level of protection)</li>\n<li>USA (Standard Contractual Clauses)</li>\n<li>Other countries (with appropriate safeguards)</li>\n</ul>\n<p><strong>Protection Guarantees:</strong></p>\n<ul>\n<li>EU Standard Contractual Clauses</li>\n<li>European Commission adequacy decisions</li>\n<li>Binding Corporate Rules</li>\n<li>Certifications and codes of conduct</li>\n</ul>\n<h3>6.4 Transfer Prohibitions</h3>\n<p><strong>We DO NOT transfer data to:</strong></p>\n<ul>\n<li>Marketing companies without consent</li>\n<li>Data brokers for sale</li>\n<li>Third parties for unauthorized marketing</li>\n<li>Organizations in countries without adequate protection (without safeguards)</li>\n</ul>\n<hr>\n<h2>7. DATA STORAGE AND SECURITY</h2>\n<h3>7.1 Data Retention Periods</h3>\n<p><strong>Active Accounts:</strong></p>\n<ul>\n<li>Profile data: until account deletion</li>\n<li>User content: until deletion or deactivation</li>\n<li>Technical logs: 12 months</li>\n<li>Communication data: until user deletes messages</li>\n</ul>\n<p><strong>Inactive Accounts:</strong></p>\n<ul>\n<li>Accounts without activity 2+ years: deactivation notification</li>\n<li>Accounts without activity 3+ years: data deletion</li>\n<li>Backup copies: up to 90 days after deletion</li>\n<li>Anonymized data: without restrictions</li>\n</ul>\n<p><strong>Legal Obligations:</strong></p>\n<ul>\n<li>Tax reporting data: according to legislation requirements</li>\n<li>Law enforcement request data: according to request terms</li>\n<li>Security logs: 3 years</li>\n<li>Litigation data: until process completion</li>\n</ul>\n<h3>7.2 Technical Security Measures</h3>\n<p><strong>Data Encryption:</strong></p>\n<ul>\n<li>TLS 1.3 for data transmission</li>\n<li>AES-256 for storing particularly important data</li>\n<li>Password hashing (bcrypt, scrypt)</li>\n<li>Backup encryption</li>\n</ul>\n<p><strong>Access Control:</strong></p>\n<ul>\n<li>Multi-factor authentication for administrators</li>\n<li>Role-based data access model</li>\n<li>Regular system account password changes</li>\n<li>Personal data access monitoring</li>\n</ul>\n<p><strong>Infrastructure Protection:</strong></p>\n<ul>\n<li>Firewalls</li>\n<li>Intrusion detection systems (IDS/IPS)</li>\n<li>Regular security updates</li>\n<li>Isolated network environment for data storage</li>\n</ul>\n<h3>7.3 Organizational Security Measures</h3>\n<p><strong>Staff Training:</strong></p>\n<ul>\n<li>Regular privacy training</li>\n<li>Non-disclosure agreement signing</li>\n<li>Limited access to personal data</li>\n<li>Incident response procedures</li>\n</ul>\n<p><strong>Audit and Monitoring:</strong></p>\n<ul>\n<li>Regular security audits</li>\n<li>Penetration testing</li>\n<li>User activity monitoring</li>\n<li>All data actions logging</li>\n</ul>\n<p><strong>Response Plans:</strong></p>\n<ul>\n<li>Data breach response plan</li>\n<li>Breach notification procedures</li>\n<li>Emergency response contacts</li>\n<li>Regular plan testing</li>\n</ul>\n<h3>7.4 Security Breach Notifications</h3>\n<p><strong>Notification Obligations:</strong></p>\n<ul>\n<li>Regulator notification within 72 hours (GDPR)</li>\n<li>User notification for high risk</li>\n<li>All incidents documentation</li>\n<li>Breach remediation measures</li>\n</ul>\n<p><strong>Notification Content:</strong></p>\n<ul>\n<li>Description of breach nature</li>\n<li>Categories of affected data</li>\n<li>Approximate number of data subjects</li>\n<li>Breach consequences and measures taken</li>\n</ul>\n<hr>\n<h2>8. DATA SUBJECT RIGHTS</h2>\n<h3>8.1 Rights under Ukrainian Legislation</h3>\n<p>According to the Law of Ukraine \"On Personal Data Protection,\" you have the following rights:</p>\n<p><strong>Right to Information:</strong></p>\n<ul>\n<li>Know purposes of your data processing</li>\n<li>Receive information about categories of processed data</li>\n<li>Know data processing periods</li>\n<li>Receive information about data recipients</li>\n</ul>\n<p><strong>Right of Access:</strong></p>\n<ul>\n<li>Receive confirmation of data processing fact</li>\n<li>Receive copies of processed data</li>\n<li>Know data sources</li>\n<li>Receive information about processing methods</li>\n</ul>\n<p><strong>Right to Rectification and Deletion:</strong></p>\n<ul>\n<li>Demand correction of inaccurate data</li>\n<li>Demand completion of incomplete data</li>\n<li>Demand data deletion when no legal grounds exist</li>\n<li>Demand processing cessation</li>\n</ul>\n<h3>8.2 Rights under GDPR</h3>\n<p>For EU users, the following additional GDPR rights apply:</p>\n<p><strong>Right to Data Portability (Article 20):</strong></p>\n<ul>\n<li>Receiving data in structured, machine-readable format</li>\n<li>Transferring data to another controller without hindrance</li>\n<li>Direct transfer between controllers (where technically feasible)</li>\n</ul>\n<p><strong>Right to Restrict Processing (Article 18):</strong></p>\n<ul>\n<li>Processing suspension when disputing data accuracy</li>\n<li>Restriction instead of deletion for unlawful processing</li>\n<li>Data preservation for legal claims protection</li>\n</ul>\n<p><strong>Right to Object (Article 21):</strong></p>\n<ul>\n<li>Objection to processing based on legitimate interests</li>\n<li>Objection to direct marketing</li>\n<li>Objection to profiling</li>\n</ul>\n<h3>8.3 Rights under CCPA (for California Residents)</h3>\n<p>California residents have the following rights under CCPA:</p>\n<p><strong>Right to Know:</strong></p>\n<ul>\n<li>Categories of personal data collected</li>\n<li>Purposes of personal data use</li>\n<li>Categories of third parties receiving data</li>\n<li>Specific pieces of collected data</li>\n</ul>\n<p><strong>Right to Delete:</strong></p>\n<ul>\n<li>Demand personal data deletion</li>\n<li>Exceptions for legal obligations fulfillment</li>\n<li>Third-party notification about deletion</li>\n</ul>\n<p><strong>Right to Opt-Out of Sale:</strong></p>\n<ul>\n<li>Refuse sale of personal data to third parties</li>\n<li>Clear opt-out instructions</li>\n<li>No discrimination for refusal</li>\n</ul>\n<h3>8.4 Rights Implementation Procedures</h3>\n<p><strong>Request Submission:</strong></p>\n<ul>\n<li>Email: privacy@worldmates.club</li>\n<li>Website form: worldmates.club/privacy-request</li>\n<li>Written request by postal address</li>\n<li>Through profile settings (for some rights)</li>\n</ul>\n<p><strong>Review Timeframes:</strong></p>\n<ul>\n<li>Standard requests: up to 10 days (Ukrainian legislation)</li>\n<li>Complex requests: up to 30 days with possible 60-day extension</li>\n<li>Extension notification: within 30 days</li>\n<li>Emergency requests: within 72 hours</li>\n</ul>\n<p><strong>Identity Verification:</strong></p>\n<ul>\n<li>Email address verification</li>\n<li>Additional documents request when necessary</li>\n<li>SMS or other verification methods</li>\n<li>Additional measures for particularly important requests</li>\n</ul>\n<hr>\n<h2>9. COOKIES AND SIMILAR TECHNOLOGIES</h2>\n<h3>9.1 Types of Cookies Used</h3>\n<p><strong>Essential Cookies:</strong></p>\n<ul>\n<li>Session cookies for maintaining login</li>\n<li>Security cookies</li>\n<li>Language preference cookies</li>\n<li>Shopping cart and form cookies</li>\n</ul>\n<p><strong>Functional Cookies:</strong></p>\n<ul>\n<li>User preference saving</li>\n<li>Interface preference memory</li>\n<li>Form auto-completion</li>\n<li>Content personalization</li>\n</ul>\n<p><strong>Analytics Cookies:</strong></p>\n<ul>\n<li>Google Analytics (traffic analysis)</li>\n<li>Yandex.Metrica (behavioral analytics)</li>\n<li>Hotjar (user experience analysis)</li>\n<li>Internal analytics systems</li>\n</ul>\n<p><strong>Advertising Cookies:</strong></p>\n<ul>\n<li>Facebook Pixel (retargeting)</li>\n<li>Google Ads (relevant advertising display)</li>\n<li>Cookies for preventing inappropriate ad display</li>\n<li>Advertising campaign effectiveness measurement</li>\n</ul>\n<h3>9.2 Cookie Management</h3>\n<p><strong>Cookie Consent:</strong></p>\n<ul>\n<li>Cookie banner on first visit</li>\n<li>Ability to choose cookie types</li>\n<li>Separate consent for analytics and advertising cookies</li>\n<li>Easy consent withdrawal method</li>\n</ul>\n<p><strong>Browser Settings:</strong></p>\n<ul>\n<li>Instructions for disabling cookies in different browsers</li>\n<li>Impact of disabling on site functionality</li>\n<li>Alternative service usage methods</li>\n<li>Regular settings verification</li>\n</ul>\n<h3>9.3 Alternative Tracking Technologies</h3>\n<p><strong>Web Beacons:</strong></p>\n<ul>\n<li>Email newsletter opening tracking</li>\n<li>Content effectiveness analysis</li>\n<li>Technical parameter monitoring</li>\n</ul>\n<p><strong>Local Storage:</strong></p>\n<ul>\n<li>HTML5 Local Storage</li>\n<li>Session Storage</li>\n<li>IndexedDB for offline functionality</li>\n</ul>\n<p><strong>Device Fingerprinting:</strong></p>\n<ul>\n<li>Device technical characteristics collection</li>\n<li>Used only for security purposes</li>\n<li>Not used for creating permanent profiles</li>\n</ul>\n<hr>\n<h2>10. MINORS PROTECTION</h2>\n<h3>10.1 Age Restrictions and Consent</h3>\n<p><strong>Minimum Usage Age:</strong></p>\n<ul>\n<li>General rule: 16 years (according to GDPR)</li>\n<li>Ukraine: 16 years (national legislation)</li>\n<li>USA (COPPA): 13 years with parental consent</li>\n<li>California (CCPA): special requirements for persons under 16</li>\n</ul>\n<p><strong>Parental/Guardian Consent:</strong></p>\n<ul>\n<li>For users 13-15 years: mandatory parental consent</li>\n<li>Parental consent verification</li>\n<li>Parents\' right to control children\'s data</li>\n<li>Data deletion possibility upon parental request</li>\n</ul>\n<h3>10.2 Additional Protection Measures</h3>\n<p><strong>Technical Restrictions:</strong></p>\n<ul>\n<li>Limited visibility of minor profiles</li>\n<li>Ban on direct messages from unknown adults</li>\n<li>Automatic filtering of potentially dangerous content</li>\n<li>Additional privacy settings by default</li>\n</ul>\n<p><strong>Educational Measures:</strong></p>\n<ul>\n<li>Digital safety training materials</li>\n<li>Safe online behavior recommendations</li>\n<li>Partnership with educational organizations</li>\n<li>Regular privacy reminders</li>\n</ul>\n<p><strong>Parental Controls:</strong></p>\n<ul>\n<li>Tools for monitoring children\'s activity</li>\n<li>Parent notifications about suspicious contacts</li>\n<li>Usage time limitation capability</li>\n<li>Family safety settings</li>\n</ul>\n<h3>10.3 Detection and Protection Procedures</h3>\n<p><strong>Minor Detection:</strong></p>\n<ul>\n<li>Behavior analysis algorithms</li>\n<li>Stated age verification</li>\n<li>Reports from other users</li>\n<li>Proactive content moderation</li>\n</ul>\n<p><strong>Violation Response:</strong></p>\n<ul>\n<li>Immediate blocking of suspicious contacts</li>\n<li>Law enforcement notification when necessary</li>\n<li>Support for affected users</li>\n<li>Cooperation with child protection organizations</li>\n</ul>\n<hr>\n<h2>11. INTERNATIONAL DATA TRANSFERS</h2>\n<h3>11.1 Transfer Countries and Regions</h3>\n<p><strong>Countries with EU Adequacy Decision:</strong></p>\n<ul>\n<li>All EU/EEA member countries</li>\n<li>Andorra, Argentina, Canada (partially)</li>\n<li>Faroe Islands, Guernsey, Isle of Man</li>\n<li>Israel, Japan, New Zealand</li>\n<li>Switzerland, Uruguay, United Kingdom</li>\n</ul>\n<p><strong>USA and Other Countries:</strong></p>\n<ul>\n<li>Transfer based on Standard Contractual Clauses</li>\n<li>Additional technical and organizational measures</li>\n<li>Destination country legislation assessment</li>\n<li>Alternative transfer mechanisms when necessary</li>\n</ul>\n<h3>11.2 Transfer Protection Guarantees</h3>\n<p><strong>Standard Contractual Clauses (SCC):</strong></p>\n<ul>\n<li>Use of current SCC 2021/914 European Commission</li>\n<li>Additional protection measures according to EDPB recommendations</li>\n<li>Government access assessment in destination country</li>\n<li>Regular adequacy review</li>\n</ul>\n<p><strong>Binding Corporate Rules (BCR):</strong></p>\n<ul>\n<li>Internal rules for company groups</li>\n<li>EU supervisory authority approval</li>\n<li>Uniform protection standards in all jurisdictions</li>\n<li>Control and compliance mechanisms</li>\n</ul>\n<p><strong>Certifications and Codes of Conduct:</strong></p>\n<ul>\n<li>ISO 27001 (information security)</li>\n<li>SOC 2 Type II (security controls)</li>\n<li>Industry codes of conduct</li>\n<li>Independent compliance audits</li>\n</ul>\n<h3>11.3 Special Transfer Situations</h3>\n<p><strong>Emergency Circumstances:</strong></p>\n<ul>\n<li>Protection of data subject vital interests</li>\n<li>Prevention of serious health or safety threats</li>\n<li>Law enforcement cooperation</li>\n<li>International sanctions compliance</li>\n</ul>\n<p><strong>Martial Law in Ukraine:</strong></p>\n<ul>\n<li>Special requirements for Ukrainian citizen data protection</li>\n<li>Transfer restrictions to certain jurisdictions</li>\n<li>Additional cybersecurity measures</li>\n<li>Cooperation with Ukrainian law enforcement</li>\n</ul>\n<hr>\n<h2>12. AUTOMATED DECISION-MAKING AND PROFILING</h2>\n<h3>12.1 Automated Systems Usage</h3>\n<p><strong>Application Areas:</strong></p>\n<ul>\n<li>News feed and recommendation personalization</li>\n<li>Automatic content moderation</li>\n<li>Relevant advertising determination</li>\n<li>Suspicious activity and fraud detection</li>\n<li>Spam prevention system</li>\n</ul>\n<p><strong>Machine Learning Algorithms:</strong></p>\n<ul>\n<li>User preference analysis</li>\n<li>Content classification</li>\n<li>Facial recognition (only with consent)</li>\n<li>Text sentiment analysis</li>\n<li>Security behavior prediction</li>\n</ul>\n<h3>12.2 Data Subject Rights Regarding Automated Decisions</h3>\n<p><strong>Right Not to be Subject to Automated Decision-Making (GDPR Article 22):</strong></p>\n<ul>\n<li>Information about automated decision-making existence</li>\n<li>Decision-making logic explanation</li>\n<li>Right to request human intervention</li>\n<li>Right to contest automated decision</li>\n</ul>\n<p><strong>Special Safeguards:</strong></p>\n<ul>\n<li>Human oversight for critically important decisions</li>\n<li>Ability to appeal automatic moderation decisions</li>\n<li>Algorithm transparency (within reasonable limits)</li>\n<li>Regular algorithm review and adjustment</li>\n</ul>\n<h3>12.3 User Profiling</h3>\n<p><strong>Types of Profiling:</strong></p>\n<ul>\n<li>Interests and preferences for personalization</li>\n<li>Advertising profiles (only with consent)</li>\n<li>Security profiles for threat detection</li>\n<li>Profiles for user experience improvement</li>\n</ul>\n<p><strong>Profiling Limitations:</strong></p>\n<ul>\n<li>Discriminatory profiling prohibition</li>\n<li>Special protection for minors</li>\n<li>Right to refuse profiling</li>\n<li>Profiling criteria transparency</li>\n</ul>\n<hr>\n<h2>13. DATA PROCESSING IN SPECIAL SITUATIONS</h2>\n<h3>13.1 Martial Law in Ukraine</h3>\n<p><strong>Additional Security Measures:</strong></p>\n<ul>\n<li>Enhanced protection of Ukrainian user data</li>\n<li>Monitoring unauthorized access attempts</li>\n<li>Geolocation data processing restrictions</li>\n<li>Special procedures for law enforcement requests</li>\n</ul>\n<p><strong>Government Agency Cooperation:</strong></p>\n<ul>\n<li>Data provision for national security needs</li>\n<li>Account blocking upon SBU request</li>\n<li>Assistance in disinformation detection</li>\n<li>Critical information infrastructure protection</li>\n</ul>\n<h3>13.2 Emergency Situations</h3>\n<p><strong>Life and Health Threats:</strong></p>\n<ul>\n<li>Data processing without consent for life-saving</li>\n<li>Medical information transfer to emergency services</li>\n<li>Emergency services coordination</li>\n<li>Contact notification in emergencies</li>\n</ul>\n<p><strong>Cybersecurity:</strong></p>\n<ul>\n<li>Threat information sharing with other platforms</li>\n<li>Incident response center cooperation</li>\n<li>Cyberattack data transfer to law enforcement</li>\n<li>Critical infrastructure protection</li>\n</ul>\n<h3>13.3 Law Enforcement Activities</h3>\n<p><strong>Law Enforcement Cooperation:</strong></p>\n<ul>\n<li>Data provision upon official requests</