(2221,'refund_terms_page','','<h1>WORLDMATES.CLUB REFUND POLICY</h1>\n<p><strong>Last Updated:</strong> August 12, 2025<br><strong>Effective Date:</strong> August 12, 2025</p>\n<hr>\n<h2>INTRODUCTION</h2>\n<p>This Refund Policy (the \"Policy\") governs the terms and conditions for refunding money for paid services of the WorldMates.club social network, provided by an individual entrepreneur registered in accordance with Ukrainian law with registration location in Dnipro, Ukraine (hereinafter \"Operator,\" \"We\").</p>\n<p>This Policy has been developed in accordance with:</p>\n<ul>\n<li>Law of Ukraine \"On Consumer Rights Protection\" No. 1023-XII</li>\n<li>Civil Code of Ukraine</li>\n<li>EU Consumer Rights Directive 2011/83/EU</li>\n<li>California Consumer Protection Law</li>\n<li>International standards for digital services consumer rights protection</li>\n</ul>\n<p><strong>Contact Information:</strong></p>\n<ul>\n<li>Name: [Entrepreneur\'s Full Name]</li>\n<li>Address: Dnipro, Ukraine, [Full Address]</li>\n<li>Email: refunds@worldmates.club</li>\n<li>Support Phone: [Phone Number]</li>\n<li>Working Hours: Mon-Fri, 9:00-18:00 (Kyiv time)</li>\n</ul>\n<hr>\n<h2>1. GENERAL PROVISIONS</h2>\n<h3>1.1 Scope of Application</h3>\n<p>This Policy applies to all paid WorldMates.club services:</p>\n<ul>\n<li>Premium subscriptions (monthly, annual)</li>\n<li>Additional features and capabilities</li>\n<li>Paid stickers and emojis</li>\n<li>Gifts and virtual gifts</li>\n<li>User promotion packages</li>\n<li>Business advertising services</li>\n<li>Any other paid platform services</li>\n</ul>\n<h3>1.2 Payment Types</h3>\n<p><strong>One-time Payments:</strong></p>\n<ul>\n<li>Individual feature purchases</li>\n<li>One-time profile enhancements</li>\n<li>Virtual gifts</li>\n<li>One-time advertising</li>\n</ul>\n<p><strong>Subscriptions:</strong></p>\n<ul>\n<li>Monthly Premium subscriptions</li>\n<li>Annual Premium subscriptions</li>\n<li>Special feature subscriptions</li>\n<li>Auto-renewable services</li>\n</ul>\n<h3>1.3 Refund Policy Principles</h3>\n<ul>\n<li><strong>Fairness</strong> &mdash; fair and clear conditions for all users</li>\n<li><strong>Transparency</strong> &mdash; clear description of all terms and procedures</li>\n<li><strong>Legal Compliance</strong> &mdash; adherence to all applicable legal standards</li>\n<li><strong>Reasonable Timeframes</strong> &mdash; optimal time frames for both parties</li>\n</ul>\n<hr>\n<h2>2. CONSUMER RIGHTS UNDER LEGISLATION</h2>\n<h3>2.1 Rights under Ukrainian Legislation</h3>\n<p>According to the Law of Ukraine \"On Consumer Rights Protection,\" consumers have the right to:</p>\n<p><strong>For Poor Quality Services:</strong></p>\n<ul>\n<li>Demand free elimination of defects</li>\n<li>Demand appropriate price reduction</li>\n<li>Demand compensation for defect elimination expenses</li>\n<li>Refuse contract execution and demand full damage compensation</li>\n</ul>\n<p><strong>For Distance Purchases:</strong></p>\n<ul>\n<li>Refuse the contract within 14 days without explanation</li>\n<li>Receive complete service information before concluding the contract</li>\n<li>Receive written order confirmation</li>\n</ul>\n<h3>2.2 Rights under EU Consumer Rights Directive</h3>\n<p>Additional rights apply for EU users:</p>\n<p><strong>Right of Withdrawal:</strong></p>\n<ul>\n<li>14-day contract withdrawal period</li>\n<li>Full refund of amounts paid</li>\n<li>Refund within 14 days after withdrawal</li>\n<li>Exceptions for digital content with consumer consent</li>\n</ul>\n<p><strong>Information Rights:</strong></p>\n<ul>\n<li>Clear information about withdrawal rights</li>\n<li>Standard withdrawal form</li>\n<li>Seller contact details</li>\n</ul>\n<h3>2.3 California Residents\' Rights (CCPA)</h3>\n<p>California residents have additional rights:</p>\n<ul>\n<li>Right to refund for automatic subscription renewals</li>\n<li>Clear subscription terms notifications</li>\n<li>Simple subscription cancellation procedures</li>\n<li>Protection from unwanted auto-payments</li>\n</ul>\n<hr>\n<h2>3. REFUND CONDITIONS BY SERVICE TYPE</h2>\n<h3>3.1 Premium Subscriptions</h3>\n<h4>3.1.1 Monthly Subscriptions</h4>\n<p><strong>Refund Conditions:</strong></p>\n<ul>\n<li>Refund within 7 days of activation (full refund)</li>\n<li>Proportional refund for unused time upon cancellation</li>\n<li>Automatic cancellation upon refund request</li>\n<li>Immediate termination of premium functions</li>\n</ul>\n<p><strong>Exceptions:</strong></p>\n<ul>\n<li>Subscription used more than 50% of time</li>\n<li>Terms of Use violations</li>\n<li>Fraud or abuse attempts</li>\n</ul>\n<h4>3.1.2 Annual Subscriptions</h4>\n<p><strong>Grace Period (first 30 days):</strong></p>\n<ul>\n<li>Full refund without questions within 30 days</li>\n<li>Refund within 3-7 business days</li>\n<li>Retention of basic account functions</li>\n</ul>\n<p><strong>After Grace Period:</strong></p>\n<ul>\n<li>Proportional refund for unused time</li>\n<li>20% deduction for administrative costs</li>\n<li>Review within 14 days</li>\n</ul>\n<h3>3.2 One-time Purchases</h3>\n<h4>3.2.1 Virtual Gifts</h4>\n<p><strong>Refund Possible:</strong></p>\n<ul>\n<li>Within 24 hours of purchase (if not sent)</li>\n<li>For platform technical errors</li>\n<li>For accidental purchase (documented)</li>\n</ul>\n<p><strong>Refund Impossible:</strong></p>\n<ul>\n<li>After sending gift to recipient</li>\n<li>After using gift in public posts</li>\n<li>After 24 hours from purchase</li>\n</ul>\n<h4>3.2.2 Stickers and Emojis</h4>\n<p><strong>Refund Conditions:</strong></p>\n<ul>\n<li>Within 48 hours of purchase</li>\n<li>If stickers unused in messages</li>\n<li>For technical download problems</li>\n</ul>\n<p><strong>Limitations:</strong></p>\n<ul>\n<li>Maximum 1 sticker refund per month per user</li>\n<li>Stickers must remain unused</li>\n<li>Refund only for last purchase</li>\n</ul>\n<h3>3.3 Advertising Services</h3>\n<h4>3.3.1 Profile Promotion</h4>\n<p><strong>Refund Befo