blocking for violations</li>\n<li>Fraud or deception attempts</li>\n<li>Refund system abuse</li>\n</ul>\n<p><strong>Objective Reasons:</strong></p>\n<ul>\n<li>Applicable time periods expired</li>\n<li>Complete service utilization</li>\n<li>No technical possibility for refund</li>\n</ul>\n<hr>\n<h2>5. REFUND PROCEDURE</h2>\n<h3>5.1 Refund Application Submission</h3>\n<h4>5.1.1 Application Methods</h4>\n<p><strong>Online Form (Recommended):</strong></p>\n<ul>\n<li>Website form: worldmates.club/refund-request</li>\n<li>Automatic receipt notification</li>\n<li>Application status tracking</li>\n<li>Fast processing (1-3 business days)</li>\n</ul>\n<p><strong>Email:</strong></p>\n<ul>\n<li>Address: refunds@worldmates.club</li>\n<li>Subject: \"Refund Request - [order number]\"</li>\n<li>All necessary documents attached</li>\n<li>Response within 24-48 hours</li>\n</ul>\n<p><strong>Phone Support:</strong></p>\n<ul>\n<li>Number: [Phone Number]</li>\n<li>Working hours: Mon-Fri, 9:00-18:00 (Kyiv time)</li>\n<li>Initial consultation and filing assistance</li>\n<li>Written confirmation required</li>\n</ul>\n<h4>5.1.2 Required Documents</h4>\n<p><strong>Mandatory Information:</strong></p>\n<ul>\n<li>Account email</li>\n<li>Transaction or order number</li>\n<li>Payment date and amount</li>\n<li>Refund reason</li>\n<li>Refund details</li>\n</ul>\n<p><strong>Additional Documents (if necessary):</strong></p>\n<ul>\n<li>Error or problem screenshots</li>\n<li>Support correspondence</li>\n<li>Circumstance confirmation documents</li>\n<li>Technical failure reports</li>\n</ul>\n<h3>5.2 Application Review</h3>\n<h4>5.2.1 Review Stages</h4>\n<p><strong>1. Initial Verification (1-2 business days):</strong></p>\n<ul>\n<li>Document completeness check</li>\n<li>User data verification</li>\n<li>Automatic receipt notification</li>\n<li>Additional document requests if necessary</li>\n</ul>\n<p><strong>2. Application Analysis (2-5 business days):</strong></p>\n<ul>\n<li>Refund condition verification<